import React from "react";
import { LineChart } from "@mui/x-charts/LineChart";

function Momentum(props) {
    const data = props.data?.content?.momentum?.main?.data
    console.log(data)

    let minutes = []
    let values = []

    data?.map((moment, index) => {
        minutes.push(moment.minute)
        values.push(moment.value)
    })

    return (
        <div className="w-full flex flex-col rounded-lg py-4 bg-white brd gap-4">
            <div className="text-center font-medium text-base px-4">Match Momentum</div>
            <div className="brd05"></div>
            <div className="h-40 md:h-72 relative">
                <LineChart
                    axisHighlight={{
                        x: "line", 
                        y: "none",
                      }}
                    xAxis={[{ data: minutes,
                        min: minutes[0],
                        max: minutes[minutes.length-1],
                        hideTooltip: true  }]}
                    series={[
                        {
                            data: values,
                            // type: "line",
                            area: true,
                            stack: "total",
                            showMark: false,
                            color: props.colorData?.home
                        },
                    ]}
                    // width={100}
                    // height={200}
                    leftAxis={null}
                    bottomAxis={null}
                />
                <div className="absolute w-full bottom-12 px-4">
                    <div className="border border-dashed border-gray-200 relative w-full">
                        <div className="right-0 absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 text-base text-center font-medium">
                            <div className=" px-2 py-0.5 bg-white brd05 rounded-full">

                            </div>
                            HT
                            </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Momentum

